import logo from "./logo.svg";
import "./App.css";
import LivroLista from "./LivroLista";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Meu Aplicativo de Livros</h1>
      </header>
      <LivroLista />
    </div>
  );
}

export default App;
